import React from 'react'
import { Outlet, Navigate } from 'react-router-dom'



export default function ProtectedRoute() {
    let  userid = localStorage.getItem("token") == null ? false : true;
    return (
        <>
            {userid ? <Outlet  /> : <Navigate to="/login" />}
        </>

    )

}
